(18, 51, 64, 'rphennen@gmail.com', 'Runnings of Marshall, East Main Street, Marshall, MN, United States', 'N/A', 'Ellen', 'Lenz', 'Female', NULL, '1952-10-01', '2017-11-22 00:00:00', 'Progress Examination', 'Wednesday', '11:30 AM', 'Yes, Fit for Duty', NULL, '8:30 AM', '2017-11-27 00:00:00', 'No', 'Yes', 'No', 'Strain', 'Lift', 'mid back / ribs , upper extremity , ', 'The patient was reaching back to her right to grab some of the separators that she utilizes for separating the scanning papers. She does this regularly throughout the day after first pulling staples from the files, to then putting the separator between. The box she was grabbing is normally to her side, but today it was behind her to the right. She states that she was grabbing the box of an estimated 250 separator sheets. When she did that she felt a twinge, but figured it was something she would get over. The pain continued to worsen over the rest of the Thanksgiving break and she went to treat at another chiropractic office that Saturday following and didn\'t get much relief from that visit. Because of that she then came into the HealthSource office on Monday, the 27th. At this time she still hadn\'t realized that this was a workmens comp injury. It was Friday December 1st that she reached back to where she set the stack of separators again that she remembered this was the way that she injured herself. At this time she reported the incident to her manager and set up a follow-up visit on Monday the 4th of December. ', NULL, NULL, NULL, '21-30#', '0-10#', '0-10#', '31-40#', '31-40#', 'No climbing', 'Constant 6-8 hrs a day', '31-40#', ' No Restrictions', 'No, she is able to remain in office.', NULL, '2017-11-22 00:00:00', '2017-12-04 00:00:00', '', 'HR of Runnings', 'Draper', 'Patient works as a clerk filing papers, scanning', 'Dr. Robert Hennen D.C.', 'Not performed', '2017-12-05 10:57:08'),
