INSERT INTO `videos` (`id`, `video_by`, `video_title`, `video_link`, `video_description`, `order`) VALUES
(12, 55, 'Clinic Awareness for Employers', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/nhxc9bvyUHE?ecver=1\" frameborder=\"0\" allowfullscreen></iframe>', 'As an employer, you can learn to work well with a clinic and get better service because they know your needs. Learn from them and they will learn from you.   \r\n', 3),
(11, 55, 'Employer Awareness for Clinics', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/db-ET-It_bE?ecver=1\" frameborder=\"0\" allowfullscreen></iframe>', 'As an employer, you can learn to work well with a clinic and get better service because they know your needs. Learn from them and they will learn from you.   \r\n\r\nAs a clinic we can learn to serve employers and make their operations easier or harder. It is your choice. If you want to work with employers the there is lots to learn!!', 2),
(10, 55, 'FitToLift Orientation', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/nhxc9bvyUHE?ecver=1\" frameborder=\"0\" allowfullscreen></iframe>', 'Congrats on taking this 1st STEP!! Welcome to FitToLift. We are a communications platform training clinics to work with employers and employers to work well with clinics. There is lots to learn, Enjoy the training and congrats on taking the 1st step!', 1),
(13, 55, 'FitToLift Report Filing', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/J07iV0pbVsc?rel=0\" frameborder=\"0\" allowfullscreen></iframe>', 'Step by Step - Filing 3 Visit Types:\r\n1) Categorized Fit4Duty / POET Form\r\n2) General Fit4Duty / POET Form', 4),
(14, 1, 'Overview Fit For Duty and POET reporting. ', 'https://youtu.be/ceboR9MDENM', 'This video describes the paperwork and process of a fit for duty and Post offer employment test.  ', 2),
(15, 1, 'Fit For Duty and POET -Orthopedic Tests', 'https://youtu.be/BJlwMGddgZA', 'These are the orthopedic tests we use to assess for possible injury and fitness for duty during a POET or a fit for duty evaluation.  ', 3),
(16, 1, 'Welcome to Fit to Lift - From Dr. Bob I will be calling your office. Lets Stay OPEN', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/5d9xjGxVI60\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 'I am Giving you FREE Training and watch for a PHONE CALL FROM MY OFFICE. Hi and thank you for taking the time to make a huge move to support the workforce of the country. Your office MUST Stay open to to help them. ', 1),
(17, 1, 'OnBoarding: Here are the steps from www.FitToLift.com', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/LlByQD8XYLs\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 'This is our OnBoarding Process. This will help you become the GO TO clinic for employers by your clinic. RIGHT NOW! Employers need you.', 1);
